import { Container } from 'react-bootstrap'
import React, { useEffect } from 'react';
import { useHistory } from 'react-router-dom'
import Solicitation from './Solicitation'
const Solsearchresult = ({searchoption, searchimage}) => {
    const history = useHistory();
    // Check if localstorage is set or not. If not set than redirect to the home page
    useEffect(() => {
        document.title = 'Solicitation Search Result';
        const storedData = JSON.parse(localStorage.getItem("MyUser"));
        if (!storedData._id) {
            history.push("/");
        }
    }, [])   // eslint-disable-line react-hooks/exhaustive-deps
    return (
        <>
            <Container className="maindivmargin">
                <Solicitation searchoption={searchoption} searchimage={searchimage} />
            </Container>
        </>
    )
}
export default Solsearchresult;
